import React from "react";

const style = {
  background: "#E7A3D9",
  border: "2px solid #6B4B65",
  fontSize: "30px",
  fontWeight: "900",
  cursor: "pointer",
  outline: "none"
};
// Destructure props from react component for value and onClick
function Square({ value, onClick }) {
  return (
    <div>
      <button style={style} onClick={onClick}>
        {value}
      </button>
    </div>
  );
}
export default Square;
